import React from 'react';
import Card from 'react-bootstrap/Card';
import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';

function Certificates() {
    const certificates = [
        {title: "CISCO CCNAv7", subtitle: "Introduction to Networks", description: ""},
        {title: "CISCO IoT", subtitle: "Introduction to IoT", description: ""},
        {title: "CISCO CyberSecurity", subtitle: "Introduction to Cybersecurity", description: ""},
        {title: "HackersGen", subtitle: "Complete Linux/Ubuntu course", description: ""},
    ];

    return (
        <Container>
            <Row xs={1} sm={2} md={2} lg={4} xl={4} className="g-4">
                {certificates.map((certificate, index) => (
                    <div key={index}>
                        <Card>
                            <Card.Header>{certificate.title}</Card.Header>
                            <Card.Body>
                                <Card.Title>{certificate.subtitle}</Card.Title>
                                <Card.Text>{certificate.description}</Card.Text>
                            </Card.Body>
                        </Card>
                    </div>
                ))}
            </Row>
        </Container>
    );
}

export default Certificates;
